import React,{useState,useEffect} from 'react'
import axios from 'axios'

import {useDispatch} from 'react-redux'

import styles from './styles'
import TableUser from './../TableUser/TableUser'


import {withStyles} from '@material-ui/core'


const App = (props) => {

  const dispatch = useDispatch()
   const [dataTableUser,setDataTableUser] = useState(Array)


   useEffect(() => {
       const fetchData = async () => {
           try {
            const getDataTableUser = await axios.get("https://dev.cong.appwifi.com/stat/client")
            console.log(getDataTableUser)
            if(getDataTableUser.error_code === 0){
              setDataTableUser(getDataTableUser)
              dispatch({type: "GET_DATA_TABLE_USER",})
            }

           } catch (error) {
               console.log(error)
           }

       }
       fetchData()
   },[dispatch])

    const {classes} = props
  return(
        <div className={classes.font}>
        <div className={classes.shape}>Thống Kê Người Dùng</div>
        <TableUser />
        </div>
  )
}
export default withStyles(styles)(App)
